import React from 'react';
import '../styles/ReviewItem.css';

const ReviewItem = ({ review }) => {
  return (
    <div className="review-item">
      <img src={review.image} alt="Review" className="review-image"/>
      <p>{review.text}</p>
      <h3>{review.author}</h3>
    </div>
  );
};

export default ReviewItem;
